import React,{useState} from 'react';
import { Box, Button, Modal } from '@mui/material';

const CardPayment = (props) => {
    
  const [open, setOpen] = useState(false);
    const handleOpen = () =>
    {
        props.handleOpen()
        setOpen(true);
    }
   const handleClose = () => setOpen(false);

  
  return (
      <Box
        className="Container_Form_Check_Infor"
      >
        <Button
              onClick={handleOpen}
        >
              Open modal
        </Button>
        <Modal
          open={open}
          onClose={handleClose}
          className="Form_Check_Infor"
        >
        <Box>
                  
         </Box>
        </Modal>
    </Box>
  );
}

export default CardPayment
